import React from 'react';
import { Container, Row, Col, Link } from 'react-bootstrap';
import { FaGithub, FaLinkedin } from 'react-icons/fa';

function Footer() {
  return (
    <Container fluid className="pt-5 bg-dark text-white py-3">
      <Row>
        <Col xs={12} md={12}>
          <div className="d-flex justify-content-center">
            <Link to="https://github.com/rudyxwhite" target="_blank" rel="noopener noreferrer" className="text-white mx-3">
              <FaGithub size={36} />
            </Link>
            <Link to="https://www.linkedin.com/in/brandon-wing-66883126b/" target="_blank" rel="noopener noreferrer" className="text-white mx-3">
              <FaLinkedin size={36} />
            </Link>
          </div>
        </Col>
      </Row>
    </Container>
  );
}

export default Footer;
